import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

let BarChart = require("./BarChart.js");

function App() {
  let state = {
    data: [12, 5, 6, 6, 9, 10],
    width: 700,
    height: 500
  };
  return (
    <div className='App'>
      <BarChart data={state.data} width={state.width} height={state.height} />
    </div>
  );
}
